import React, { useState } from 'react';
import './StudentProfile.css';

const StudentProfile = () => {
    const [profilePic, setProfilePic] = useState('/path/to/default/profile.jpg');
    const [nickname, setNickname] = useState('NicknameStudente');

    const handleProfilePicChange = (event) => {
        if (event.target.files && event.target.files[0]) {
            setProfilePic(URL.createObjectURL(event.target.files[0]));
        }
    };

    return (
        <div className="student-profile">
            <div className="profile-card">
                <div className="card-header">
                    <div className="profile-pic-container">
                        <img src={profilePic} alt="Profile" className="profile-pic" />
                        <div className="overlay">
                            <input type="file" onChange={handleProfilePicChange} id="file-input" />
                            <label htmlFor="file-input" className="upload-button">Change Photo</label>
                        </div>
                    </div>
                </div>
                <div className="card-body">
                    <h2 className="nickname">{nickname}</h2>
                    <div className="buttons">
                        <button onClick={() => window.location.href = '/view-all-tournaments'}>View All Tournaments</button>
                        <button onClick={() => window.location.href = `/mysection/${nickname}`}>My Section</button>
                    </div>
                    <p className="bio">Welcome to your profile! Share something interesting about yourself.</p>
                </div>
            </div>
        </div>
    );
};

export default StudentProfile;
